import React from 'react';
import './App.css'; // Asumând că stilurile sunt definite în App.css

// Componenta pentru bara de navigare
function Navbar() {
  return (
    <div className="navbar">
      <div className="logo">RoomRanger</div>
      <div className="nav-items">
        <a href="/">Home</a>
        <a href="/map">Map</a>
        <a href="/about-us">About Us</a>
        <a href="/profile">Profile</a>
      </div>
    </div>
  );
}

// Componenta pentru harta
function Map() {
  return (
    <div className="map">
      {/* Aici ai încorpora o hartă folosind, de exemplu, Google Maps API sau o altă bibliotecă */}
    </div>
  );
}

// Componenta pentru butoanele de la baza paginii
function ActionButtons() {
  return (
    <div className="action-buttons">
      <button className="search-btn">Search</button>
      <button className="filter-btn">Filter</button>
      <button className="book-btn">Book</button>
    </div>
  );
}

// Componenta principală App care leagă totul împreună
function App() {
  return (
    <div className="App">
      <Navbar />
      <Map />
      <ActionButtons />
    </div>
  );
}

export default App;
